// frontend/src/pages/doador/DoadorList.jsx
import React, { useEffect, useState } from 'react';

function DoadorList() {
    const [doadores, setDoadores] = useState([]);

    useEffect(() => {
        fetch('http://localhost:8080/doadores')
            .then(response => {
                if (!response.ok) throw new Error('Falha ao buscar doadores');
                return response.json();
            })
            .then(data => setDoadores(data))
            .catch(error => alert(error.message));
    }, []);

    return (
        <div>
            <h2>Lista de Doadores</h2>
            <ul>
                {doadores.map(doador => (
                    <li key={doador.cpf}>
                        {doador.nome} - {doador.tipoSanguineo}
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default DoadorList;
